import React from 'react';
import { BrowserRouter } from 'react-router-dom';

import Topbar from '../../components/Topbar';

import FeedRoute from '../../routes';

import Post from '../../components/Post';


import './App.scss';

const App = () => (
  <div>
    <BrowserRouter>
      <Topbar />
      <FeedRoute />
      <Post />
    </BrowserRouter>
  </div>
);

export default App;
